import React, { Component } from 'react';

export default class Works extends Component {
    render() {
        return (
            <article className="Works" id="myWorks">
                <a data-aos="fade-down-right" data-aos-duration="1100" className="caseOne" href="https://chrisdemey.github.io/restaurant-css-framework/" target="_blank"></a>
                <a data-aos="fade-down-left" data-aos-duration="1100" className="caseTwo" href="https://chrisdemey.github.io/TD2-cssgrid/" target="_blank"></a>
                <a data-aos="fade-right" data-aos-duration="1100" className="caseThree" href="https://cleobuck.github.io/allezcinev3/" target="_blank"></a>
                <a data-aos="fade-left" data-aos-duration="1100" className="caseFour" href="https://chrisdemey.github.io/Hitman-site/" target="_blank"></a>
                <p>Cette section sera régulièrement mise à jour</p>
            </article>
        );
    }
}
